import React, { useState } from 'react';
import { Container, TextField, Button, Typography, capitalize } from '@mui/material';
import regimg from "../component/assets/regester.png"
import instalogo from "../component/assets/instagram-logo.png";
import FacebookIcon from '@mui/icons-material/Facebook';
import Divider from '@mui/material/Divider';


function RegisterPage() {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // In a real application, you would typically send this data to a backend for user registration.
    // For this example, we'll just display the submitted data in the console.
    console.log(formData);
  };

  return (
    <div className='regpage'>
       <img src={regimg} alt="" className="regimg"/>

      <form onSubmit={handleSubmit} className="regform">
      <img id="insta" src={instalogo} alt="instalogo" width={"100px"} />
      <Typography
      sx={{color:"gray",fontWeight:"100px"}}
      >Sign up to see photos and videos from your friends</Typography>
      <Button
      sx={{textTransform:'capitalize'}}
        variant="contained"
        color="secondary"
        startIcon={<FacebookIcon />}
      >
        Sign Up with Facebook
      </Button>
      <Divider sx={{width:"100%",color:"primary"}}>or</Divider>


        <TextField
        sx={{width:360,backgroundColor:'white',borderRadius:1}}
        label="UserName"
        name="username"
          variant="filled"
          margin="normal"
          size="small"
          value={formData.username}
          onChange={handleChange}
        />

        <TextField

        sx={{width:360,backgroundColor:'white',borderRadius:1}}
        label="Email"
        name="email"
          variant="filled"
          margin="normal"
          size="small"
          value={formData.email}
          onChange={handleChange}
        />
        <TextField
          fullWidth
          sx={{width:360,backgroundColor:'white',borderRadius:1}}
          label="Password"
          name="password"
            variant="filled"
            margin="normal"
            type="password"
            size="small"
          value={formData.password}
          onChange={handleChange}
        />
        <Button

          type="submit"
          variant="contained"
          color="secondary"
          size="large"
          sx={{ mt: 2 }}
        >
          Login
        </Button>

      </form>
      </div>   );
}

export default RegisterPage;
